import { Injectable } from '@angular/core';
import { AutresComplicationsSD } from '../models/AutresComplicationsSD';
import { HttpClient, HttpResponse } from '@angular/common/http';
import { Observable } from 'rxjs';

@Injectable({
  providedIn: 'root'
})
export class AutrecompService {
  private apiUrl = 'https://localhost:7129/api/AutresComplicationsSds';

  constructor(private http: HttpClient) { }
  autrecomp(AutresComplicationsSD: AutresComplicationsSD): Observable<HttpResponse<any>> {
    console.log('Creating it with data:', AutresComplicationsSD);

    return this.http.post<any>(`${this.apiUrl}/autrecomp`, AutresComplicationsSD, { observe: 'response' });
  }}
